In his enchanting debut feature, Jacques Tati stars as a fussbudget of a
postman who is thrown for a loop when a traveling fair comes to his village.

Originally filmed using two cameras, in both black &amp; white and Thomson-color.
The Thomson firm went bankrupt before the film could be processed.
In 1995, new technology allowed the restoration of the color copy, which was
finished and released by Tati's daughter Sophie Tatischeff and cinematographer
Francois Ede.

